/*INSERT INTO Article (article_id, article_title)
VALUES (1, 'Urban parks, value uplift and green gentrification: An application of the spatial hedonic model in the city of Brisbane');
*/
INSERT INTO Chunk (chunk_id, article_id, chunk_text, chunk_embeddings)
VALUES (1, 1, 'This paper explores the impact of urban parks on real estate prices making use of a hedonic price approach. Focusing on Brisbane, Australia, as a case study site, we use spatial hedonic models to analyse housing sales data across 15,000 sales transactions to investigate the effects of parks on nearby housing prices, paying attention to park typology and classification. Our findings indicate that recreational and sport parks are differently associated with price variations. The study also examines a specific and significant inner-city park currently undergoing a major redevelopment-namely Victoria Park. Our analysis of the Victoria Park site seeks to quantify the value uplift, that is, the future increase in property prices as a result of the transformation of the current private golf course in this location into a new publicly accessible parkland. This study’s property economics modelling analysis indicates the conversion of Victoria Park from a golf course to public parkland will increase property prices by an average of 3 % for properties located within 750 m of the park. The article concludes with a dis\x02cussion of value capture opportunities that these findings present as well as challenges of green gentrification for this and similar urban renewal projects and possible policy responses.This paper explores the impact of urban parks on real estate prices making use of a hedonic price approach. Focusing on Brisbane, Australia, as a case study site, we use spatial hedonic models to analyse housing sales data across 15,000 sales transactions to investigate the effects of parks on nearby housing prices, paying attention to park typology and classification. Our findings indicate that recreational and sport parks are differently associated with price variations. The study also examines a specific and significant inner-city park currently undergoing a major redevelopment-namely Victoria Park. Our analysis of the Victoria Park site seeks to quantify the value uplift, that is, the future increase in property prices as a result of the transformation of the current private golf course in this location into a new publicly accessible parkland. This study’s property economics modelling analysis indicates the conversion of Victoria Park from a golf course to public parkland will increase property prices by an average of 3 % for properties located within 750 m of the park. The article concludes with a discussion of value capture opportunities that these findings present as well as challenges of green gentrification for this and similar urban renewal projects and possible policy responses.','0.0059478804,-0.001834736,0.026540289,-0.0017997092,-0.02303094,0.017800275,-0.011215241,-0.0236314,-0.014104116,-0.031090435,-0.030209761,0.014224207,0.012889854,0.01593218,-0.00058586453,-0.007479051,0.03250485,-0.021990145,0.0099609485,-0.00065383315,-0.031917732,0.013757184,-0.014250894,-0.018761009,-0.016639387,0.035627235,0.016679417,-0.005640979,0.0037295178,0.014784636,0.008433114,-0.008353053,-0.024071736,0.0062080794,-0.022510542,-0.0064149043,0.0057377196,0.0032991888,0.022297045,0.00027333395,0.0128298085,-0.0098542,-0.005240673,-0.016599357,0.012142616,0.007939403,0.019134628,-0.033545643,-0.015852118,0.0026003213,0.006471614,0.035253618,-0.024912378,0.008099525,-0.018867757,-0.019735087,0.01706638,0.01770687,0.0035160212,-0.013470298,-0.0033375514,-0.01619905,-0.02529934,0.016626043,-0.011128508,0.0020849272,0.0005037184,0.0034459678,0.018907787,0.00013208014,0.048917398,0.04961126,0.023204407,-0.0067017903,0.016652731,-0.015118225,-0.018240612,-0.018414076,0.010928354,0.031090435,-0.004009732,-0.015011476,-0.03458644,0.019548278,0.017213158,0.006131354,-0.0048870696,0.037148397,0.031010373,0.024912378,0.0110617895,0.007385646,-0.010027666,0.0037395256,-0.023537993,0.0019331445,-0.015732028,0.004163183,0.027074032,-0.013150053,0.009407192,0.009427207,-0.04235238,-0.010407956,-0.015425125,0.012142616,0.0017563427,-0.0316508