'Urban green space can refer to different typologies of areas, characterized by various functions and degrees of naturalness, such as urban parks and gardens, outdoor sports areas, school gardens, grassland and wetlands. Irrespective of their characterization, urban green areas provide a variety of benefits to the population, which range from the opportunity to spend time in nature and enjoy aesthetically pleasing landscapes to environmental benefits such as improvement in air quality, water run-off regulation, conservation of biodiversity, and so on (Chiesura, 2004). More generally, it has been recognized that urban green space offers a wide range of ecosystem services, including biophysical, environmental, cultural, and perceptive dimensions (Andersson et al., 2015; Bolund and Hunhammar, 1999; Wiggering et al., 2006). Additionally, many economic benefits are associated with urban green areas and, more generally, with environmental goods and services (Ambrey and Fleming, 2014; Bertram and Rehdanz, 2015). It is well known that the use and transformation of environmental systems have been shown to have a variety of economic effects and repercussions, to the extent that the environment is considered a key (positive or negative) externality within the urban economics literature (Palmquist, 2005). In light of the growing importance of environmental factors in urban and land economics, specific evaluation tools have been developed that allow the value of the environment and urban green spaces to be estimated in order to establish and assess the foreseeable benefits of certain actions involving their use and transformation (van der Heide and Heijman, 2013).',
