VALUES (3, 1, 
'The majority of studies on economic valuation of urban green spaces employ a Total Economic Value (TEV) approach (Pearce and Turner, 1990; Harnik, 2014). The TEV approach is based on the assumption that any good or service is composed of various attributes, some of which are concrete and easily measured, while others may be more difficult to quantify. The overall value of the good or service is given by the sum of all of these components. Different evaluation techniques are available for estimating the TEV. According to Pearce and Turner (1990), the methods can be divided into two main families: i) Revealed preferences methods, that derive the value of an environmental and landscape resource from the observation of individuals’ decisions in real markets. These methods include Travel Cost Method (Voke et al., 2013) and Hedonic Pricing method (Freeman III et al., 2014); ii) Stated preferences methods, that are based on the creation of a simulated market data collection by asking individuals for their Willingness To Pay (WTP) for using a certain good or service, or Willingness To Accept (WTA) abandoning a certain good. Contingent Valuation Method (Carson, 2000; Price, 2000) and Conjoint Analysis/Choice Experiments method belong to this family.',
