'This study builds the established TEV methodological framework and extends it by applying a hedonic pricing methodology to explore the effect of urban parks on real estate prices in the city of Brisbane, Queensland, Australia. In recent years, different studies have highlighted that the presence of urban parks positively affects the price of apartments in the surrounding areas. In particular, the use of the Hedonic Modelling approach allows researchers to estimate the value of environmental amenities by appraising the role of proximity to urban parks in the determination of the price of real estate (Morancho, 2003; Jim and Chen, 2006). While it has been demonstrated that proximity to urban green areas plays an important role in the determination of housing prices in surrounding areas, the impact of the specific characteristics of urban parks-including their physical features, spatial context, and typology-has been less explored (Kim et al. 2019; Czembrowski and Kronemberg, 2016; Holt and Borsuk, 2020). In order to fill this gap, the present paper investigates how proximity to urban parks affects housing prices in the city of Brisbane in terms of increase in property values, focusing in particular on the value uplift associated with the different park characteristics and typologies. Beyond the benefits delivered by urban parks, the article also discusses the negative social impacts that these areas produce in terms of gentrification, in that the added value to housing created by urban greening interventions leads to higher rental prices, and thus can result in the displacement of economically vulnerable residents (Anguelovski et al., 2018).',
