'Starting from this premise, the objective of the article is twofold. First, it aims to provide an exploration of the effect of urban parks on housing prices in the city of Brisbane, according to the different park typologies. Second, drawing on the results of the empirical model and considering the transformation of a private 18-hole golf course into a publicly accessible parkland, the paper quantifies the potential impact on the surrounding real estate properties, thus providing the first estimation of the value uplift associated with the development of this urban park. The impact of the presence of the new park in terms of increase in housing prices is also discussed from the point of view of possible green gentrification effects that could negatively impact the area under examination. The study will be of interest to urban greening researchers, property valuers, and decision makers involved in the planning and management of urban green renewal projects, as its findings (a) demonstrate an approach for quantifying both the value uplift and associated urban ecosystem services provided by urban parks and (b) contribute to debates surrounding the issue of green gentrification.',
