'The importance of quantifying the value of non-market goods can be explained by the increasing demands on natural capital and ecosystems services on our urbanized planet (Guo et al., 2010) and the need for people to live in an inclusive, healthy, resilient, safe and sustainable environment (Loh et al, 2020; Yigitcanlar et al, 2019; Bottero et al., 2020; Caprioli et al. 2021). Many scholars point to the role and benefit of natural capital to improve human well-being, social cohesion, and social inclusion, both qualitatively and quantitatively (Bertram and Rehdanz, 2015; Dennis and James, 2016; Ekins, 2003; Jim and Chen, 2009). A special attention has been devoted in the literature to the analysis of natural capital in exploring the relationship between urban green spaces and property valuation (Jones et al., 2019; Valente et al. 2020; Ekins, 2003). In particular, the Hedonic Price Method – HPM (Rosen, 1974) has been widely applied to estimate the contribution to property values delivered by environmental amenities (Crompton, 2001). Indeed, since Ridker and Henning (1967) found that hedonic pricing models are statistically significant in the context of environmental economics, increasing attention has been given to the evaluation of externalities generated by natural resources and environmental amenities and their effect on house prices (Geoghegan, Wainger, and Bockstael, 1997; McLeod, 1984). In recent years, the availability of urban data and advances in geo-statistics have made valuation studies of urban green spaces more and more important (Holt and Borsuk, 2020). The rationale behind HPM is that the house is a composite good and its value is determined by multiple characteristics, including tangible housing elements (e.g., surface, floor, state of conservation, etc.) and intangible elements (e.g., landscape quality, environmental services, etc.). Accordingly, the hedonic function allows a marginal price of each characteristic to be assigned, leading to a monetary estimation of each housing attribute. ',
