'An analysis of the literature shows the ongoing interest in the adoption of this approach for estimating the value of environmental externalities (Sirmans et al., 2006). Recent publications analyse, among other factors, the spillover effects related to ecological lands and landscape proximity (Xiao et al., 2019), waterfronts (Dahal et al., 2019), urban rivers (Chen et al., 2019), forests (Lamhamedi et al. 2021), the flood risks perception (Sado-Inamura and Fukushi, 2019), environmental amenities across space (Hiebert and Allen, 2019), preference between detention and retention ponds (Sohn et al. 2020), and the impact of multimodal accessibility to green space (Chen et al. 2021). With specific reference to the value of urban green areas, Kong et al. (2007) pointed out that for the city of Jinan (China) a 1 % improvement in accessibility to parks will lead to an increase in housing price per square meter of 1.6 %. Analogously, for the city of Salo (Finland), Tyrvainen and Miettinen (2000) found that individuals are willing to pay 4.9 % more for houses with a forest view. An analysis of Turin (Italy) illustrates how the quality of the area, including proximity to green areas, affects in a positive way the value of a property (D’Acci, 2014). Dell’Anna et al (2022) expressly analysed the impact of green infrastructures on housing prices in the city of Singapore, pointing out the existence of an influence of city parks, regional parks, and nature areas on apartment values. Specific studies by Kim et al., 2019, Nur et al., 2020 and Piaggio, 2021 in the cities of Seoul, Kuala Lumpur and San Jos´e(Costa Rica), respectively, explore the role of size and characteristics of the urban green areas in the determination of the prices. Cheung and Fernandez (2021) examine the different effects of three categories of green spaces (i.e. urban parks, regional reserves and volcanic parks) on residential property transactions in Auckland (New Zealand). Several studies that analyse the effects of urban greening, including greenbelts, urban tree programs and creation of parks, on property values, indicate that buyers appreciate the importance of living in neighbourhoods with greener and denser vegetation (Jun and Kim, 2017; Li et al., 2019; Payton et al., 2008; Yuan et al., 2020). In another study focused on the city of Stockholm, the negative influence of crimes in parks on apartment prices is estimated (Iqbal and Wilhelmsson, 2018).',
