VALUES (8, 1, 
'With specific reference to urban parks, Table 1 details the most recent applications that investigate the application of HPM for estimating the spillovers effects of this typology of areas. As far as the city of Brisbane is concerned, the analysis of the literature highlights a number of applications of HPM for estimating the effects of different urban goods and services, including transport infrastructures, urban forestry and flood control. In particular, Table 2 details the main fields of research of these studies with a focus on the characteristic variables used for the implementation of the different HPM approaches. Our literature review substantiates the novelty of the research described in this article fourfold: (1) It is the first local application of an HPM valuation on the effects of urban parks on property values in the city of Brisbane. (2) An additional element of innovation of this study is related to the fact that the characteristics of the parks are considered in the estimation of the effects on housing pricing. (3) The paper’s originality is further corroborated by the study’s development of the evaluation following the approach of the spatial hedonic models, an implementation of the traditional HPM that is receiving more and more attention in the real estate appraisal (LeSage and Pace, 2009; Krause and Bitter, 2012; Bottero et al., 2018). (4) Finally, the effects of urban parks in terms of increases in property values are also discussed with regards to the possible impacts of green gentrification. Our review suggests that the studies that examine green gentrification impacts grounded in the empirical results of hedonic modelling are very limited at the moment (Jo Black and Richards, 2020; Bockarjova et al., 2020).',
